INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1001, 0, "春咲 ひより", 1.4, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, "お！\nあそこに困ってそうな人発見！", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1002, 0, "草野 優衣", 1.4, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, "大切な人を\n守れるようになりたい…って", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1003, 0, "士条 怜", 1.4, 0, "フェンシングを始めてみては？", 0, "少しは磨かれると思いますよ。", 0, "キミに必要な集中力と感性が", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1004, 0, "穂高 みそぎ", 1.5, 0, "ねぇ、にいちゃん！", 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, "今日はなにして遊ぶ？", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1006, 0, "風宮 あかり", 1.4, 0, "風宮あかりです", 0, "私といっしょに…\nいかない？", 0, "ねぇ…", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1007, 0, "出雲 宮子", 1.5, 0, "出雲宮子なのー", 0, "食べ物の恨みは怖いのー", 0, "プリンたべたいのー", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1008, 0, "虹村 雪", 1.4, 0, "ボクは虹村雪。", 0, "いいよ。\n見られることは運命さ…", 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1009, 0, "柊杏奈", 1.4, 0, "フッ…聞いて後悔するがいい！", 0, "人呼んで「疾風の冥姫」!!", 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1010, 0, "姫宮 真歩", 1.5, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, "ほんまおおきにやわ～♪", 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1011, 0, "衣之咲 璃乃", 1.4, 0, "衣之咲璃乃です！", 0, "ここで会ったが\n100年目～！", 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1012, 0, "柏崎 初音", 1.4, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, "ち、超能力って…\n何のことかな～？", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1016, 0, "美波 鈴奈", 1.4, 0, "ちょす！\n美波鈴奈だよ～♪", 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, "一応カリスマ読モJKやってまっす！", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1017, 0, "喜屋武 香織", 1.4, 0, "はいたーい。\n喜屋武香織さー。", 0, "でも、沖縄もとってもいいとこさー", 0, "東京は遊園地みたいなところさー", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1018, 0, "支倉 伊緒", 1.4, 0, "支倉伊緒です。", 0, "イオちゃんって呼んでね。", 0, "先生って呼ばれるのは\nくすぐったいから", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1020, 0, "茜 ミミ", 1.5, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "ミミをおいてかないでぇ～", 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1021, 0, "栗林 くるみ", 1.5, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "ふぇぇぇぇぇん……", 0, "あの……\nふぇ……", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1022, 0, "風宮 より", 1.4, 0, "風宮よりです。\nあああああ！", 0, "なんてありがとうございます！", 0, "こんな私に貴重な時間を\n割いていただき、", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1023, 0, "北条 綾音", 1.5, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "私こっち行きたいー\nね、早く早くー", 0, "おにいちゃんどこいくの？\nえ？", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1025, 0, "天野 すずめ", 1.4, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, "これて何か違う…\nあああすみません！", 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1027, 0, "倉石 恵理子", 1.4, 0, "……クスクス…私は\n…倉石恵理子……", 0, "離しませんわ………\n絶対に…!!", 0, "あなたは…運命の……\n伴侶……", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1028, 0, "佐々木 咲恋", 1.4, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "…そうでしょ？？", 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1029, 0, "桜井 望", 1.4, 0, "桜井望だよ！\nよろしくねっ", 0, "あはは、\n私もまだまだだなぁ～", 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1030, 0, "ニノン・ジュベール", 1.4, 0, "デケデケデンっ！", 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1031, 0, "上喜 しのぶ", 1.4, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, "おかしいですね……", 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1033, 0, "野戸まひる", 1.5, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, "そう、\nオラのボケに突っ込める相方が…！", 0, "けんども\nそれには足りないモンが…", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1034, 0, "綾瀬 ゆかり", 1.4, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "ちょ\nちょっと一杯飲んできます…！", 0, "ちょっと緊張しちゃって…", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1036, 0, "氷川 鏡華", 1.5, 0, "氷川鏡華…です", 0, "これ以上お話しすることは…\nないです！", 0, "知らない人とは話しちゃいけないので", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1038, 0, "柏崎 栞", 1.4, 0, "柏崎…栞です。", 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, "……あ、アラーム。", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1040, 0, "双葉 碧", 1.4, 0, "ふ、双葉碧です。", 0, "野に咲く花が、\n唯一の話相手です。", 0, "私、一人も友達がいなくて……", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1042, 0, "三角 千歌", 1.4, 0, "三角千歌です。", 0, "そう思っています。", 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1043, 0, "安芸 真琴", 1.4, 0, "安芸真琴だ。", 0, "う、疑ってすまなかったな…", 0, "あぁ？\nお前のそいつの仲間か？", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1044, 0, "イリヤ・オーンスタイン", 1.4, 0, "わらわこそは夜を総べる者！", 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, "生けとし生ける全ての者よ！", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1045, 0, "遠見 空花", 1.4, 0, "そこで騎士は妖精を乱暴に……", 0, "ｌク、クウカに何かご用ですか!?", 0, "ぐふふふふ……はっ！", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1046, 0, "宮坂たまき", 1.4, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1048, 0, "大神 美冬", 1.4, 0, "大神美冬よ！", 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, "それでは早速クエストに…", 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (2, 0, 1, 1049, 0, "星野静流", 1.4, 0, "星野静流だよ！", 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, "クエストもバトルも\n掃除も洗濯も", 1, 1);
